package com.example.client.login;

public class Usuario {

	private String nombre= "";
	private String apellido= "";
	private String UserProfileID= "";
	private String DocumentNumber= "";
	private String DocumentType= "";
	private int claveTemporal = -1;
	private int esUsuarioInspira= -1;
	private int esSolicitarRegistro= -1;
	private int esCambioNombreUsuario= -1;
	private String roleID= "";
	private String tipoClienteID= "";
	private String tipoUsuarioID= "";
	private String tokenSSOprivate = "";
	private String UID = "";
	
	
	
	
	
	public Usuario() {
	
		// TODO Auto-generated constructor stub
	}
	
	
	

	public String getNombre() {
		return nombre;
	}
	public void setNombre(String nombre) {
		this.nombre = nombre;
	}
	public String getApellido() {
		return apellido;
	}
	public void setApellido(String apellido) {
		this.apellido = apellido;
	}
	public String getUserProfileID() {
		return UserProfileID;
	}
	public void setUserProfileID(String userProfileID) {
		UserProfileID = userProfileID;
	}
	public String getDocumentNumber() {
		return DocumentNumber;
	}
	public void setDocumentNumber(String documentNumber) {
		DocumentNumber = documentNumber;
	}
	public String getDocumentType() {
		return DocumentType;
	}
	public void setDocumentType(String documentType) {
		DocumentType = documentType;
	}
	public int getClaveTemporal() {
		return claveTemporal;
	}
	public void setClaveTemporal(int claveTemporal) {
		this.claveTemporal = claveTemporal;
	}
	public int getEsUsuarioInspira() {
		return esUsuarioInspira;
	}
	public void setEsUsuarioInspira(int esUsuarioInspira) {
		this.esUsuarioInspira = esUsuarioInspira;
	}
	public int getEsSolicitarRegistro() {
		return esSolicitarRegistro;
	}
	public void setEsSolicitarRegistro(int esSolicitarRegistro) {
		this.esSolicitarRegistro = esSolicitarRegistro;
	}
	public int getEsCambioNombreUsuario() {
		return esCambioNombreUsuario;
	}
	public void setEsCambioNombreUsuario(int esCambioNombreUsuario) {
		this.esCambioNombreUsuario = esCambioNombreUsuario;
	}
	public String getRoleID() {
		return roleID;
	}
	public void setRoleID(String roleID) {
		this.roleID = roleID;
	}
	public String getTipoClienteID() {
		return tipoClienteID;
	}
	public void setTipoClienteID(String tipoClienteID) {
		this.tipoClienteID = tipoClienteID;
	}
	public String getTipoUsuarioID() {
		return tipoUsuarioID;
	}
	public void setTipoUsuarioID(String tipoUsuarioID) {
		this.tipoUsuarioID = tipoUsuarioID;
	}
	public String getTokenSSOprivate() {
		return tokenSSOprivate;
	}
	public void setTokenSSOprivate(String tokenSSOprivate) {
		this.tokenSSOprivate = tokenSSOprivate;
	}
	public String getUID() {
		return UID;
	}
	public void setUID(String uID) {
		UID = uID;
	}
	
	
	
	
	

}
